import ReactDOM from 'react-dom';
import './styles/App.css';
import App from './App';
import {AppProvider} from './context/ProductsContext'

ReactDOM.render(
 < AppProvider>
<React.StrictMode>   
   <App />
</React.StrictMode>  
 </AppProvider>,

  document.getElementById('root')
);
